import { useState } from "react";
import { Link } from "react-router-dom";
import style from "./NavBar.module.css";
import ImageHome from "./dog.png";

const NavBar = ({ handleChange, handleSubmit }) => {
  const [selectedTemperament, setSelectedTemperament] = useState("");

  const handleSearch = (e) => {
    e.preventDefault();
    handleSubmit(selectedTemperament);
  };

  return (
    <div>
      <div className={style.mainContainer}>
        <Link to="/">
          <img className={style.logo} src={ImageHome} alt="imagen Beagle"></img>
        </Link>
        <form onSubmit={handleSearch}>
          <input className={style.input} placeholder="Insert Dog Name" type="search" />
          <select
            className={style.select}
            value={selectedTemperament}
            onChange={(e) => setSelectedTemperament(e.target.value)}
          >
            <option value="">Select temperament</option>
            <option value="calm">Calm</option>
            <option value="friendly">Friendly</option>
            <option value="energetic">Energetic</option>
            <option value="playful">Playful</option>
          </select>
          <button className={style.btn} type="submit">
            Buscar
          </button>
        </form>
        <div>
          {/* any other content */}
        </div>
        <Link className={style.main} to="/home">
          Home
        </Link>
        <Link className={style.main} to="/create">
          Create Dog
        </Link>
        <Link className={style.main} to="/about">
          About
        </Link>
      </div>
    </div>
  );
};

export default NavBar;
